○使用上のご注意:<br>
■金属アレルギーなど、皮膚の弱い方のネックレスとして使用せず、ペンダントヘッドを持ち歩いてご使用ください。
■アクセサリーをご使用中に万が一、かゆみ・かぶれ等、皮膚に異常を感じた場合には直ちにご使用をお止め頂き、専門医にご相談をお願いいたします。
■どうしても製造上付く、小さな傷がある場合がございます。目立つものではありませんが気になる場合はお控えください。
■小さなお子様のいらっしゃる環境では誤って飲み込まないよう、手の届かない場所に保管をお願い致します。
■アクセサリーは非常にデリケートに作られており、破損しやすくなっているものがございますのでお取り扱いにご注意ください。<style type="text/css">
